  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:16.924120\",\n\t\"name\": \"tamarac-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tamarac
  National Wildlife Refuge summarizes Refuge activities during the 1995 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ Land acquisition is also covered.  The report includes a planning section which
  discusses public participation, compliance with environmental and cultural resource
  mandates, research, and investigations.  Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, and safety is given.
  \ Habitat management is also covered.  Subjects include wetlands, forests, croplands,
  grasslands, haying, fire management, pest control, Farmers Home Administration Conservation
  Easements, and private lands.  The wildlife section of the report discusses endangered
  species, threatened species, waterfowl, marsh birds, waterbirds, shorebirds, raptors,
  game mammals, marking, and banding.  The public uses of the Refuge described in
  this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
  trapping, wildlife observation, law enforcement, and cooperating associations.  The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment utilization/replacement, communications
  systems, computer systems, and energy conservation.  Cooperative programs and economic
  uses of the Refuge are provided at the end; Refuge brochures are attached.\",\n\t\"license_title\":
